import React from "react";
import './Address.css';

const Address = () => {
    return (
        <div className="oli3">
            <h1>#ONEPIECE #ワンピース ＃OP_FILMRED</h1>
            <video><iframe width="560" height="315" src="https://www.youtube.com/embed/vC_Y930hTiU" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></video>


        </div>
    );
}
export default Address;
